import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ListUsersComponent } from './users/list-users/list-users.component';
import { GetAllPatientsComponent } from './patients/get-all-patients/get-all-patients.component';
import { AssignMedicalStaffComponent } from './medical-staff/asign-medical-staff/asign-medical-staff.component';



@NgModule({
  declarations: [
    AppComponent,
    ListUsersComponent,

    GetAllPatientsComponent,
    AssignMedicalStaffComponent

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
